export default [
    {
        label: "首页",
        key: "home",
        icon: renderIcon(HomeIcon)
    },
    {
        label: '房产',
        key: "realEstate",
        icon: renderIcon(Home20Regular),
        children: [
            {
                label: () =>
                    h(
                        RouterLink, {
                        to: '/'
                    },
                        { default: () => '房屋管理' }
                    ),
                key: "realEstate",
            },
            {
                label: () =>
                    h(
                        RouterLink, {
                        to: '/'
                    },
                        { default: () => '商铺管理' }
                    ),
                key: "realEstate",
            }
        ]
    },
    {
        label: "费用",
        key: "cost",
        icon: renderIcon(MoneyIcon)
    },
    {
        label: "办公",
        key: "office",
        icon: renderIcon(BezierCurveSquareIcon)
    },
    {
        label: "停车",
        key: "parking",
        icon: renderIcon(VehicleCarProfileLtrIcon)
    },
    {
        label: "报修",
        key: "repair",
        icon: renderIcon(CalendarEditIcon)
    },
    {
        label: "采购",
        key: "purchase",
        icon: renderIcon(ShoppingBagIcon)
    },
    {
        label: "设备",
        key: "equipment",
        icon: renderIcon(DeveloperBoardIcon)
    },
    {
        label: "疫情",
        key: "epidemic",
        icon: renderIcon(SyringeIcon)
    }
];
